import "./SignIn.css";

export default function SignIn(){
  return (
    <div className="sign-in">
      <h1>Sign In</h1>
      <div>
        <input placeholder="Username" />
      </div>
      <div>
        <input placeholder="Password" />
      </div>
      <button className="pin">Sign In</button>
      <div>New to Clover App? <span>Sign up now.</span></div>
    </div>
  )
}
